import { Button } from "react-bootstrap";


function Homepage() {

    function clear() {
        window.localStorage.setItem('progress','0')
        localStorage.setItem('codiceProgress','0')
        localStorage.setItem('healthProgress','0')
        localStorage.setItem('checked','false')
        localStorage.setItem('checked2','false')
        localStorage.setItem('codiceChecked','false')
        localStorage.setItem('codiceChecked2','false')
        localStorage.setItem('codiceChecked3','false')
        localStorage.setItem('healthChecked','false')
        localStorage.setItem('healthChecked2','false')
        localStorage.setItem('healthChecked3','false')
    }

    return (
        <div>
            <Button onClick={clear}> Reset </Button>
        </div>

    )
}

export default Homepage
